// ** Reactstrap Imports
import { Input } from 'reactstrap'

const PricingHeader = ({ duration, setDuration }) => {
  const onChange = e => {
    if (e.target.checked) {
      setDuration('yearly')
    } else {
      setDuration('monthly')
    }
  }

  return (
    <div className='text-center'>
      <h1 className='mt-5'>Avg. Network Pricing</h1>
      <p className='mb-2 pb-75'>
        No minimums, free ad rotation across networks. National Coverage. Free Analytics.
      </p>
      
      <h3 className='mt-5'>TRADITIONAL IMPRESSIONS</h3>
      <p className='mb-2 pb-75'>Billboards  -  From 80c/impression</p>
      <p className='mb-2 pb-75'> Native Network  -  From 8c/impression</p>
      <p className='mb-2 pb-75'>Your Ad in Times Square Shot - From $18 per segment</p>
 
      <p className='mb-2 pb-75'>SEARCH ADS/KEYWORD MATCH</p>
      <p className='mb-2 pb-75'>Free Digital Billboard/Smart Screen Feature</p>
      <p className='mb-2 pb-75'>Billboards  -  From 8c/impression</p>
      <p className='mb-2 pb-75'>Native Network  -  From 0.08c/impression</p>
      <p className='mb-2 pb-75'>High Traffic Billboards - From $1.8 per segment</p>
    </div>
  )
}

export default PricingHeader
